    <div id="container">
        <h2 style="">PrintPage - Plugin Demo<hr></h2>
		<!-- Button to print the whole page-->
        <input class="ignore-print btn" type="button" onclick="printAll()" value="Print Full Page">
        <div class="top">
			<!-- Element with an image and a button to print the image-->
            <div id="left-section">
                <div class="img" ></div>
				<!-- Call the printImage() to print the image on click of the button-->
                <input class="ignore-print btn" type="button" onclick="printImage()" value="Print Image"></input>
            </div>

			<!-- Element with some texts and button to print the texts-->
            <div id="right-section" >
                <div class="text-block" ><b>Some text to print</b>
                </div>
				<!-- Call the printText() to print the text on click of this button-->
                <input type="button" onclick="printText()" value="Print Text" class="ignore-print btn"></input>
            </div>
        </div>
